import React, { Component } from "react";
import NavList from "./Data/navList";
import NavCategory from "./Components/NavCategory";
// import jordanLogo from "./Components/";

import "./Nav.scss";

class Nav extends Component {
  constructor() {
    super();
    this.state = {
      mainCategory: [],
      isHover: false,
    };
  }
  handleMouseOver = (e) => {
    console.log(e.target);
    this.setState({
      isHover: true,
    });
  };
  handleMouseOut = () => {
    this.setState({
      isHover: false,
    });
  };

  render() {
    console.log(this.state.isHover);
    return (
      <header className="Nav">
        <div className="header">
          <ul className="coLists">
            <li className="coList">
              <a className="linkCo" href="www">
                <span className="linkName">Nike</span>
              </a>
            </li>
            <li className="coList">
              <a className="linkCo" href="www">
                <span className="linkName">Join US</span>
              </a>
            </li>
            <li className="coList">
              <a
                className="linkCo"
                href="www"
                onMouseOver={this.handleMouseOver}
                onMouseOut={this.handleMouseOut}
              >
                {/* <img
                  className="linkSvgJordan test"
                  src="./images/jordanLogo.svg"
                  alt=""
                /> */}
                <img
                  className="linkSvgJordan test"
                  src={
                    this.state.isHover
                      ? "./images/jordanLogo.svg"
                      : "./images/jordanLogoHover.svg"
                  }
                  alt=""
                />
              </a>
            </li>

            <li className="coList">
              <a className="linkCo" href="www">
                <img
                  className="linkSvgCon"
                  src="./images/converseLogo.svg"
                  alt=""
                />
              </a>
            </li>
          </ul>
          <ul className="myMenuLists">
            <li className="myMenuList">
              <span className="linkMyMenuName">
                <a className="linkMyMenuSign" href="www">
                  회원가입
                </a>
                <span className="linkNull">/</span>
                <a className="linkMyMenuSign" href="www">
                  로그인
                </a>
              </span>
            </li>

            <li className="myMenuList">
              <a className="linkMyMenu" href="www">
                <span className="linkMyMenuName">고객센터</span>
              </a>
            </li>
            <li className="myMenuList">
              <a className="linkMyMenu" href="www">
                <img
                  className="myMenuCartImg"
                  src="./images/cartImg.svg"
                  // onMouseOver="./images/cartImg.svg"
                  // onMouseOut="./images/cartImgHover.svg"
                  alt=""
                />
              </a>
            </li>
            <li className="myMenuList">
              <a className="linkMyMenu" href="www">
                <span className="linkMyMenuName">
                  <img
                    className="myMenuLocationImg"
                    src="./images/locationImg.svg"
                    alt=""
                  />
                  대한민국
                </span>
              </a>
            </li>
          </ul>
        </div>

        <nav className="navMain">
          <a className="mainLogoLink" href="www">
            <span className="mainLogoImg">
              <img src="./images/nikeMainLogo.svg" alt="" />
            </span>
          </a>
          <ul className="mainCategoryList">
            {NavList?.map((el, i) => {
              return (
                <NavCategory key={i} title={el.categoryTitle} data={el.data} />
              );
            })}

            <NavCategory />
          </ul>
          <div className="searchContainer">
            <span className="mainInputName">
              <input className="mainInput" placeholder="검색"></input>
            </span>
            <button className="searchBtn">
              <img src="./images/searchBtn.svg" alt="" />
            </button>
          </div>
        </nav>
      </header>
    );
  }
}
export default Nav;
